import React from 'react';
import styled from 'styled-components';

interface IBoardItem {
  title: string;
  tags: string;
  wr_datetime: string;
  like_count: number;
  share_count: number;
  scrab_count: number;
}

const BoardListWrapper = styled.div`
  width:100%;
  height:100%;
  display:flex;
  flex-flow: row wrap;
`;
const BoardListItemWrapper = styled.div`
  width:100%;
  paddin:10px;
`;


const dummy = [
  {
    title: "쓰레기통 안에 로또 당첨 복권 소유 권한은 누구한테 있나요?",
    tags: "법률|생활",
    wr_datetime: "2021-01-09 12:55:00",
    like_count: 291,
    share_count: 38,
    scrab_count: 22
  },
  {
    title: "쓰레기통 안에 로또 당첨 복권 소유 권한은 누구한테 있나요?",
    tags: "법률|생활",
    wr_datetime: "2021-01-09 12:55:00",
    like_count: 291,
    share_count: 38,
    scrab_count: 22
  },{
    title: "쓰레기통 안에 로또 당첨 복권 소유 권한은 누구한테 있나요?",
    tags: "법률|생활",
    wr_datetime: "2021-01-09 12:55:00",
    like_count: 291,
    share_count: 38,
    scrab_count: 22
  },{
    title: "쓰레기통 안에 로또 당첨 복권 소유 권한은 누구한테 있나요?",
    tags: "법률|생활",
    wr_datetime: "2021-01-09 12:55:00",
    like_count: 291,
    share_count: 38,
    scrab_count: 22
  },{
    title: "쓰레기통 안에 로또 당첨 복권 소유 권한은 누구한테 있나요?",
    tags: "법률|생활",
    wr_datetime: "2021-01-09 12:55:00",
    like_count: 291,
    share_count: 38,
    scrab_count: 22
  },{
    title: "쓰레기통 안에 로또 당첨 복권 소유 권한은 누구한테 있나요?",
    tags: "법률|생활",
    wr_datetime: "2021-01-09 12:55:00",
    like_count: 291,
    share_count: 38,
    scrab_count: 22
  },
];

const BoardList = () => {
  return (
    <BoardListWrapper>
      {dummy.map((item:IBoardItem):JSX.Element => (
        <BoardListItem item={item}/>
      ))}
    </BoardListWrapper>
  )
}

const BoardListItem = ({ item }):JSX.Element => {
  return (
    <BoardListItemWrapper>
      <div className='tile_aside'>
        {item.like_count}
      </div>
      <div className='tile_main'>
        <div className="head_title">{item.title}</div>
        <div className="tag_wrap">
          {item.tags.split("|").map((item: string) => (
            <span>{item}</span>
          ))}
        </div>
      </div>
    </BoardListItemWrapper>
  )
}

export default BoardList;
